import React from "react";
import styled from "styled-components";
import { fade } from "@material-ui/core/styles";
import {
  Container,
  SubHeader,
  SubText,
  Text,
  NormalText,
  CaptionText,
} from "../../styledComponents";
import { Avatar, Divider } from "@material-ui/core";
import MailIcon from "@material-ui/icons/Mail";
import PhoneIcon from "@material-ui/icons/LocalPhone";
import TenantIcon from "@material-ui/icons/PersonPin";
import BusinessIcon from "@material-ui/icons/Business";
import ArrowIcon from "@material-ui/icons/ArrowForward";
import BathroomIcon from "@material-ui/icons/BathTub";
import BedIcon from "@material-ui/icons/KingBed";
import GardenIcon from "@material-ui/icons/AmpStories";
import CarIcon from "@material-ui/icons/DirectionsCar";
import GraphIcon from "@material-ui/icons/ShowChart";
import ViewIcon from "@material-ui/icons/Style";
import MiniTicketItem from "./MiniTicketItem";
import MbanzaLogo from "../../../public/static/mbanza.png";
import SingleTicket from "../tickets/SingleTicket";

const Tag = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-radius: 20px;
  background-color: #e1e1e1;
  padding: 2px 15px;
  margin: 3px 3px;
`;
const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  flex: 1;
  padding-top: 30px;
  max-height: calc(100vh - 115px);
  overflow: scroll;
  ::-webkit-scrollbar {
    display: none;
  }
`;

const TenantCard = ({ tenant }) => {
  return (
    <Container
      flex={0.5}
      row
      customStyles={{
        borderRadius: 3,
        padding: 20,
        marginRight: 8,
      }}
      color="white"
    >
      <Container
        row
        middle
        flex={0.1}
        color="transparent"
        customStyles={{ height: "100%" }}
      >
        <TenantIcon style={{ fontSize: 20 }} />
      </Container>
      <Container column space={"space-between"} flex={0.8} color="transparent">
        <SubText
          customStyles={{
            fontSize: 16,

            marginBottom: 0,
            marginTop: 0,
          }}
        >
          Tenant
        </SubText>
        <Container
          color="transparent"
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <SubHeader
            customStyles={{
              fontSize: 18,
            }}
          >
            {tenant.firstName + " " + tenant.lastName}
          </SubHeader>
        </Container>
        <Container
          row
          center
          color="transparent"
          customStyles={{ paddingTop: 5, paddingBottom: 5 }}
        >
          <Avatar
            style={{
              backgroundColor: fade("#F7DC6F", 0.3),
              width: 25,
              height: 25,
              marginRight: 8,
            }}
          >
            <MailIcon style={{ fontSize: 15, color: "#F1C40F" }} />
          </Avatar>
          <SubText>{tenant.comm_email}</SubText>
        </Container>
        <Container
          row
          center
          color="transparent"
          customStyles={{ paddingTop: 1, paddingBottom: 1 }}
        >
          <Avatar
            style={{
              backgroundColor: fade("#58D68D", 0.3),
              width: 25,
              height: 25,
              marginRight: 8,
            }}
          >
            <PhoneIcon style={{ fontSize: 15, color: "#27AE60" }} />
          </Avatar>
          <SubText>{tenant.tel_no}</SubText>
        </Container>
      </Container>
      <Container
        row
        middle
        flex={0.1}
        color="transparent"
        customStyles={{ height: "100%", paddingTop: 2 }}
      >
        <ArrowIcon style={{ fontSize: 18 }} />
      </Container>
    </Container>
  );
};

const ManagerCard = ({ managingAgent }) => {
  console.log(manag)
  return (
    <React.Fragment>
      {managingAgent === null ? (
        <Container
          flex={0.5}
          row
          customStyles={{
            borderRadius: 3,
            padding: 20,
            marginRight: 8,
          }}
          color="white"
        >
          <Container
            row
            middle
            flex={0.1}
            color="transparent"
            customStyles={{ height: "100%" }}
          >
            <BusinessIcon style={{ fontSize: 20 }} />
          </Container>
          <Container
            column
            space={"space-between"}
            flex={0.8}
            color="transparent"
          >
            <SubText
              customStyles={{
                fontSize: 16,

                marginBottom: 0,
                marginTop: 0,
              }}
            >
              Managing Agent
            </SubText>
          </Container>
          <Container
            row
            middle
            flex={0.1}
            color="transparent"
            customStyles={{ height: "100%", paddingTop: 2 }}
          >
            <ArrowIcon style={{ fontSize: 18 }} />
          </Container>
        </Container>
      ) : (
        <Container
          flex={0.5}
          row
          customStyles={{
            borderRadius: 3,
            padding: 20,
            marginRight: 8,
          }}
          color="white"
        >
          <Container
            row
            middle
            flex={0.1}
            color="transparent"
            customStyles={{ height: "100%" }}
          >
            <BusinessIcon style={{ fontSize: 20 }} />
          </Container>
          <Container
            column
            space={"space-between"}
            flex={0.8}
            color="transparent"
          >
            <SubText
              customStyles={{
                fontSize: 16,

                marginBottom: 0,
                marginTop: 0,
              }}
            >
              Managing Agent
            </SubText>
            <Container
              color="transparent"
              customStyles={{ paddingTop: 10, paddingBottom: 10 }}
            >
              <SubHeader
                customStyles={{
                  fontSize: 18,
                }}
              >
                {managingAgent.company_name}
              </SubHeader>
            </Container>
            <Container
              row
              center
              color="transparent"
              customStyles={{ paddingTop: 5, paddingBottom: 5 }}
            >
              <Avatar
                style={{
                  backgroundColor: fade("#F7DC6F", 0.3),
                  width: 25,
                  height: 25,
                  marginRight: 8,
                }}
              >
                <MailIcon style={{ fontSize: 15, color: "#F1C40F" }} />
              </Avatar>
              <SubText>{managingAgent.comm_email}</SubText>
            </Container>
            <Container
              row
              center
              color="transparent"
              customStyles={{ paddingTop: 1, paddingBottom: 1 }}
            >
              <Avatar
                style={{
                  backgroundColor: fade("#58D68D", 0.3),
                  width: 25,
                  height: 25,
                  marginRight: 8,
                }}
              >
                <PhoneIcon style={{ fontSize: 15, color: "#27AE60" }} />
              </Avatar>
              <SubText>{managingAgent.tel_no}</SubText>
            </Container>
          </Container>
          <Container
            row
            middle
            flex={0.1}
            color="transparent"
            customStyles={{ height: "100%", paddingTop: 2 }}
          >
            <ArrowIcon style={{ fontSize: 18 }} />
          </Container>
        </Container>
      )}
    </React.Fragment>
  );
};

const HouseFact = ({ house, house_type }) => {
  return (
    <Container
      flex={1}
      customStyles={{ padding: 10, marginBottom: 10 }}
      row
      center
      color="transparent"
    >
      <Container column flex={1} color="transparent">
        <Container
          row
          flex={1}
          color="transparent"
          customStyles={{ marginBottom: 7 }}
        >
          <Container row center flex={1} color="transparent">
            <NormalText customStyles={{ fontSize: 12, color: "#979a9a" }}>
              PROPERTY TYPE
            </NormalText>
          </Container>
          <Container row center flex={1} color="transparent">
            <SubText customStyles={{ fontSize: 14, color: "#E59866" }}>
              {house_type.house_type}
            </SubText>
          </Container>
        </Container>
        <Container
          row
          flex={1}
          color="transparent"
          customStyles={{ marginBottom: 7 }}
        >
          <Container column flex={1} color="transparent">
            <NormalText customStyles={{ fontSize: 12, color: "#979a9a" }}>
              YEAR BUILT
            </NormalText>
